import{_ as e,c as i,o as l,d as a}from"./app.5323da9f.js";const p=JSON.parse('{"title":"Life","description":"","frontmatter":{},"headers":[{"level":2,"title":"THis Life home","slug":"this-life-home","link":"#this-life-home","children":[]},{"level":2,"title":"打车","slug":"打车","link":"#打车","children":[]},{"level":2,"title":"做饭","slug":"做饭","link":"#做饭","children":[]},{"level":2,"title":"囤药","slug":"囤药","link":"#囤药","children":[]},{"level":2,"title":"考研借到异地考试","slug":"考研借到异地考试","link":"#考研借到异地考试","children":[]},{"level":2,"title":"考研当天","slug":"考研当天","link":"#考研当天","children":[]},{"level":2,"title":"双房见家长","slug":"双房见家长","link":"#双房见家长","children":[]}],"relativePath":"life/index.md"}'),h={name:"life/index.md"},r=a('<h1 id="life" tabindex="-1">Life <a class="header-anchor" href="#life" aria-hidden="true">#</a></h1><h2 id="this-life-home" tabindex="-1">THis Life home <a class="header-anchor" href="#this-life-home" aria-hidden="true">#</a></h2><p>20221206 生活就是一地鸡毛</p><p>20230104 生活就像打仗，每天都有新的敌人，而我要做的就是从不放弃</p><h2 id="打车" tabindex="-1">打车 <a class="header-anchor" href="#打车" aria-hidden="true">#</a></h2><p>顺风车打车经验：</p><ul><li><p>1.提前半小时安排出行，比如老妈打车 10 点出发，那就要打九点半的车</p></li><li><p>2.车主接单后，一定要打电话确认，如果做不到在约定的时间内赶到，请及时说出来，我有急事，着急回去。</p></li></ul><h2 id="做饭" tabindex="-1">做饭 <a class="header-anchor" href="#做饭" aria-hidden="true">#</a></h2><ul><li>清蒸鲈鱼</li><li>风干的牛肉炒大白菜很好吃</li><li>海底捞吃饭，不用双拼底料，麻辣底料自己制作搅拌下就好</li></ul><h2 id="囤药" tabindex="-1">囤药 <a class="header-anchor" href="#囤药" aria-hidden="true">#</a></h2><ul><li>鼻炎药 孟鲁司特钠</li><li>鼻炎药 盐酸非索非那定片</li><li>如何通过保险报销药品，已购门诊险。</li><li>感冒药收集，主要：感康/快客/白加黑</li><li>退烧相关：布洛芬/乙酰氨基酚(孕妇能吃)</li></ul><h2 id="考研借到异地考试" tabindex="-1">考研借到异地考试 <a class="header-anchor" href="#考研借到异地考试" aria-hidden="true">#</a></h2><ul><li><a href="https://zsb.gench.edu.cn/" target="_blank" rel="noreferrer">上海考研地点</a></li><li>一定要到考场附近酒店住下来，考研每天来回奔波很是辛苦</li></ul><h2 id="考研当天" tabindex="-1">考研当天 <a class="header-anchor" href="#考研当天" aria-hidden="true">#</a></h2><ul><li>犯了一个 fatal 的错误，且难以弥补，懊悔不已，身份证和准考证没带过去</li><li>后续所有的事情坚决要以核心事情为准，且一定要优先处理，其他次要事情往后处理</li></ul><h2 id="双房见家长" tabindex="-1">双房见家长 <a class="header-anchor" href="#双房见家长" aria-hidden="true">#</a></h2><ul><li>家家有本难念的经，我家这本特别难念，老丈人很难搞定，而且关系很僵。不知道咋处理了？</li><li>正常家庭来说，父母都是疼爱子女的，遇到一个不疼爱自己的父母很难搞得定，而且又是远嫁，没有优势？</li><li>父母不同意原因？大胆猜测下 1.远嫁，解决之道：高铁飞机方便，逢年过节尽量回来看望父母 2.经济，彩礼需要攒一攒，可能超过想象，但是只要是一个可控的范围都好接受 3.婚后生活，年轻人还是要靠自己奋斗，所以只要自己足够努力，生活质量还是阔以保证的 4.结婚后小孩姓谁，如果非要入赘才能同意婚事，这个我得需要跟父母商量商量</li></ul>',17),t=[r];function d(n,s,c,o,u,f){return l(),i("div",null,t)}const m=e(h,[["render",d]]);export{p as __pageData,m as default};
